const QUIZZES_URL = 'http://localhost:4000/api/quizzes'

const findQuestionsForQuiz = (qid) => {
    return fetch(`${QUIZZES_URL}/${qid}/questions`)
}

export default {
    findQuestionsForQuiz
}
